\f0\i\fs56 \cf2 Search, Sort, Filter - the "SSF" of Zone?}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
\cocoascreenfonts1{\fonttbl\f0\fnil\fcharset0 Miso;}
{\colortbl;\red255\green255\blue255;\red25\green25\blue25;}
\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\slleading-300\pardirnatural

\f0\i\fs30 \cf2 \expnd0\expndtw0\kerning0
Scrolling through the list to find a Contact is the most basic form of searching, but definitely the simplest and often probably also the fastest when there are no more than a couple of "screens worth" of Contacts. I think scrolling and "scanning" is such a common behaviour on almost every computing device, mobile and desktop, that people are very used to it, comfortable with it, and actually also quite good at it. Key to helping users to "scan" effectively will be our visual design of the list, making the Contact Name visually identifiable - "scannable" (in a word) using size, colour, proximity etc.}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
\cocoascreenfonts1{\fonttbl\f0\fnil\fcharset0 Miso;}
{\colortbl;\red255\green255\blue255;\red76\green76\blue76;}
\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\ri-1940\slleading-400\pardirnatural

\f0\i\fs36 \cf2 \expnd0\expndtw0\kerning0
Another point we've yet to agree on, but something which I've always felt was an important part of the app concept from the outset, was the idea of the "Me" Contact. The "Me" Contact represents the User themselves, i.e. their Timezone. It's analogous to the "You are here" marker on maps in shopping malls and tourist attractions, or the marker on a GPS device which represents the device's current location. I think the "Me" Contact performs the same role - it orients the User, not to a location, but to a time - to the "when", related to the people (Contacts) which User cares about.}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
\cocoascreenfonts1{\fonttbl\f0\fnil\fcharset0 Miso;}
{\colortbl;\red255\green255\blue255;\red76\green76\blue76;}
\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\ri-1940\slleading-400\pardirnatural

\f0\i\fs36 \cf2 \expnd0\expndtw0\kerning0
I think it's likely that people will often simply scroll up and down through a list to find the Contact that they are looking for "by eye". We need to ensure that our visual design aids "scalability" by using all the standard design "tricks" like colour, size, location, white space and proximity etc.}

