\f0\i\fs30 \cf2 \expnd0\expndtw0\kerning0
If "Timezone" is the default sort order, then the A-Z Index control is of no use and won't be displayed whilst this sort order is active.}

{\rtf1\ansi\ansicpg1252\cocoartf1187\cocoasubrtf340
\cocoascreenfonts1{\fonttbl\f0\fnil\fcharset0 Miso;}
{\colortbl;\red255\green255\blue255;\red76\green76\blue76;}
\pard\tx560\tx1120\tx1680\tx2240\tx2800\tx3360\tx3920\tx4480\tx5040\tx5600\tx6160\tx6720\ri-1940\slleading-400\pardirnatural

\f0\i\fs36 \cf2 \expnd0\expndtw0\kerning0
I don't believe we've agreed on this point yet, but from the outset, I always envisaged the default sort order for "Contact Lists" to be Timezone, i.e. Contacts who are "behind" you would be displayed above you in the list  (before you, in other words), and Contacts who are "ahead" of you would be displayed below you (after you, in other words). I can definitely see a need for other sort orders, but to me, Timezones, and your (the User) temporal place in relation to the people you care about (your Contacts) is at the heart of what Zone is all about. }

