We've yet to agree on this, I think, but I always envisaged the default sort order for "Contact Lists" (aside from "Group Edit Mode", which I'd treat differently) being "Timezone". So the "Me" Contact (you, the User) would be displayed in the list, with Contacts who are "behind" you displayed above you (before you, essentially), and Contacts who are "ahead" of you displayed below you (after you, essentially). If we agree on the basic idea of the default sort order being Timezone, then the A-Z Index control, something I thought would be displayed almost permanently, plays no part when a Contact is sorted in Timezone order, does it? An A-Z Index control only works if a list is sorted in alphabetical order.}

